import { ChatEngine } from 'react-chat-engine';
import CHatFeed from './components/ChatFeed';
import './App.css';

const App = () => {
    return(
        <ChatEngine
            height="100vh"
            projectID="47a764ff-9b6a-4f64-9a21-0a487245bc30"
            userName="test1"
            userSecret="test1" 
            renderChatFeed={(chatAppProps) => <chatFeed {...chatAppProps} />} 
        />
    );
}

export default App;
